1	Android Avanzado - Base de datos	https://ed.team/sites/default/files/styles/large/public/courses/images/android-avanzado_2.png?itok=xqY7bWvK	Cada vez interactuamos más con las aplicaciones, guardamos configuraciones, recibimos y mandamos datos. Para evitar que toda esa información se pierda, en este curso te enseñamos lo que necesitas para manejar base de datos en tus aplicaciones Android. Solo necesitas tener bien definidos los conceptos básicos, estos los aprendimos en Android desde cero pero también es válido si lo aprendiste de manera autodidacta.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	android-avanzado---base-de-datos
11	Gestión y Desarrollo de Proyectos web	https://ed.team/sites/default/files/styles/large/public/courses/images/desarrollo-web.png?itok=_U7lMlky	En todo proyecto web, existen diferentes etapas que involucran a diferentes especialistas en marketing, diseño, programación, bases de datos, etc. Si bien existen muchos cursos sobre estas areas en separado, ninguno te cuenta como trabajan en conjunto a lo largo de todo un proyecto. Por eso hemos preparado este diplomado en el que veremos:Diseño de interfaces y experiencia de usuario.\r\nDiseño y gestión de bases de datos.\r\nDesarrollo backend\r\nDesarrollo frontend\r\nGestión comercial\r\nAl finalizar este curso, el estudiante tendrá un panorama completo de como abordar proyectos web en todas sus etapas. Así podrá estar mejor preparado como freelance o para empezar su propia agencia de desarrollo web. El curso es dictado por expertos reconocidos en toda Latinoamerica.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	gestión-y-desarrollo-de-proyectos-web
12	Git Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/git-poster-720_2.jpg?itok=EZD4QT60	GIT es un sistema de control de versiones (VCS por sus siglas en inglés) que nos ayuda a llevar el historial completo de un proyecto, pudiendo saber en detalle incluso que línea específica se editó en un archivo. Además, es el VCS más usado en el mundo y es un requisito indispensable en toda entrevista laboral. En este curso aprenderás a usar GIT desde cero, desde conocer los tres estados hasta trabajar en proyectos grandes con equipos de trabajo. De hecho, otra de las grandes ventajas de GIT es que muchos desarrolladores pueden trabajar en el mismo proyecto sin crear conflictos de código.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	git-desde-cero
13	Go desde cero	https://ed.team/sites/default/files/styles/large/public/courses/images/go-poster-720_2.jpg?itok=32fgM3Sv	Go es un lenguaje creado por Google en 2009 y que ha ganado mucha fuerza en el desarrollo actual. De hecho, empresas como Dropbox, Docker, Facebook, Netflix, Uber oTwitter (entre otras) confian en Go para sus desarrollos (fuente). Con Go puedes programar tu aplicación una sola vez y luego compilarla para cualquier sistema operativo (incluso móviles). Además tiene una curva de aprendizaje sencilla pero a la vez el poder y robustez de lenguajes como C, siendo su especialidad los sistemas que requieran alto rendimiento.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	go-desde-cero
15	HTML5 Desde Cero (2017)	https://ed.team/sites/default/files/styles/large/public/courses/images/html-poster-720_2.jpg?itok=F4nje3SQ	HTML es el lenguaje sobre el que está construida toda la web y su estándar HTML5 la revolucionó por completo haciendo del navegador el programa más usado en el mundo. Este es el curso obligatorio si quieres iniciar tu carrera de desarrollador web y no tienes experiencia. También es ideal si ya tienes experiencia pero quieres estar actualizado en el estándar HTML5 a 2017.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	html5-desde-cero-(2017)
16	Illustrator Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/illustrator%20poster-720_1.jpg?itok=8otfZWgN	llustrator es el software lider en el mundo del diseño vectorial y el preferido por los expertos. Illustrator es el programa ideal para el diseño de afiches, pancartas, comics, logotipos, identidad corporativa e incluso mockups de interfaces. Para tomar este curso no necesitas conocimientos previos, iremos completamente desde cero hasta crear tu primer proyecto.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	illustrator-desde-cero
17	Java Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/java-poster-720_1.jpg?itok=JzGWxi04	En este curso, aprenderás Java desde lo más elemental siendo guiado paso a paso por el profesor. Al finalizar el curso crearemos un proyecto en vivo en el que aplicaremos todo lo aprendido. Si quieres aprender Java y dedicarte a escritorio, web o Android este curso es para ti. También si estás viendo Java en la universidad y quieres reforzar conceptos o mejorar tus habilidades.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	java-desde-cero
18	JavaScript Avanzado - Paradigmas de programación	https://ed.team/sites/default/files/styles/large/public/courses/images/JavaScriptAvanzado-poster-720_2.jpg?itok=HVlHx_21	JavaScript es un lenguaje multiparadigma, lo que significa que se puede programar con distintos estilos (paradigmas). Incluso podemos usar más de uno en un mismo proyecto según nuestras necesidades. En este curso avanzado de JavaScript aprenderás como trabajar con los paradigmas de Orientación a Objetos, Funcional, Reactivo y Asíncrono mientras aprendes conceptos más profundos del lenguaje. Se recomienda haber tomado primero el curso JavaScript Desde Cero.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	javascript-avanzado---paradigmas-de-programación
19	JavaScript Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/js-poster-720_1.jpg?itok=WeOvwEt8	JavaScript es el lenguaje que le da vida a la web. Es el único lenguaje de programación del lado del cliente (lo interpreta el navegador) y con NodeJS podemos usarlo también en el servidor, con lo cual, un programador JavaScript puede convertirse en fullstack sin aprender un nuevo lenguaje. JavaScript es también el lenguaje con mayor demanda laboral en el desarrollo web y con mayor proyección a futuro. En este curso aprenderás JavaScript en su última versión ES6.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	javascript-desde-cero
20	Nodejs Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/nodejs-poster-720_2.jpg?itok=26Q6d2l7	Node.js es el entorno de programación de lado del servidor del lenguaje JavaScript que utiliza un modelo asíncrono y dirigido por eventos. En este curso conocerás como funciona y serás capaz de desarrollar tus primeras aplicaciones de tipo FullStack: cliente, servidor y base de datos con un sólo lenguaje de programación. Si has usado JavaScript en el frontend, esta es tu oportunidad para convertirte en un FullStak Developer, ampliar tus oportunidades profesionales y aprender a crear aplicaciones modernas con el lenguaje más importante de la web: javascript.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	nodejs-desde-cero
14	HTML5 Avanzado - Progressive Web Apps	https://ed.team/sites/default/files/styles/large/public/courses/images/pwa-poster_1.png?itok=CmNPn3bq	Las progressive web apps (PWA) nos permiten tener aplicaciones web HTML5 que se comportan como aplicaciones nativas del teléfono. Estas nos brindan múltiples ventajas en el desarrollo web/movil. Si ya tienes conocimientos básicos de HTML, CSS y Javascript puedes tomar este curso.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	html5-avanzado---progressive-web-apps
21	Photoshop Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/photoshop-poster-720_1.jpg?itok=pT-FQ3Y_	Photoshop es el estándar mundial de diseño y retoque fotográfico. Los principales profesionales del mundo lo usan en sus trabajos y existe muchísimo material en internet como plugins, freebies, templates, etc. Con este curso te acercarás al diseño de mano del programa lider del mercado, aprenderás sobre color, manejo de herramientas, filtros, ediciones no destructivas, capas, fusiones, estilos, etc. Y terminaremos el curso con tres proyectos (no uno, ¡sino tres!): el diseño de una tarjeta de presentación, un montaje fotográfico y el diseño de un website.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	photoshop-desde-cero
22	PHP Avanzado - Laravel	https://ed.team/sites/default/files/styles/large/public/courses/images/laravel-poster-720_2.jpg?itok=smn1STPx	Laravel es el framework que revitalizó PHP desde su nacimiento, fue creado por Taylor Otwell en 2011, ayuda a los programadores crear aplicaciones de manera sencilla, soporta el uso de paquetes de composer, imagina que tienes paquetes de lego, tu imaginación es el límite para las cosas que puedes construir con Laravel. Cuenta con su propio ORM, manejo de rutas, autenticación y un amplio ecosistema de utilidades que han hecho de Laravel el framework PHP favorito de los "artesanos de la web".	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	php-avanzado---laravel
23	PHP Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/php-poster-720_1.jpg?itok=7neDmH3x	PHP es uno de los lenguajes más importantes de la web. Millones de sitios como Wikipedia, Facebook, WordPress o Drupal se construyeron con PHP. Con PHP puedes crear sitios y aplicaciones web dinámicas con conexión a base del datos. Este curso te llevara de la mano desde los principios del lenguaje hasta la creacion de una tienda en línea completamente funcional que podrás personalizar y vender a tus clientes, multiplicando tu inversión en este curso.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	php-desde-cero
24	Programación Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/programacion-poster-720_1.jpg?itok=008sbnZY	La programación puede parecer intimidante al principio, sin embargo todos los lenguajes comparten los mismos principios y la misma lógica. Este curso te enseñará a pensar como un programador, creando algoritmos y aplicando soluciones en tres lenguajes: Java, Go y JavaScript. Si quieres convertirte en programador, este curso te enseñará los fundamentos para programar en cualquier lenguaje.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	programación-desde-cero
25	Python Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/python_0.png?itok=ozJeUd8U	Python es un lenguaje de programación poderoso, eficiente y de alto nivel. En este curso, aprenderemos con José Dimas Luján, como empezar en el mundo de Python, crear programas poderosos con código legible usando el lenguaje preferido de los científicos, analistas y expertos en seguridad. Usaremos lo aprendido para crear un proyecto de análisis basico de un sitio web, donde podremos analizar e inspeccionar cualquier sitio y saber si cumple las condiciones para un eficiente posicionamiento.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	python-desde-cero
