27	Sass Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/sass-poster-720_1.jpg?itok=bSzjmad8	Css no es un lenguaje de programación, por lo que carece de variables, funciones, condicionales, etc.Esto hace que proyectos medianos a grandes sean imposibles de manejar con Css plano. Los diseñadores se sobreescriben estilos unos a otros, se repiten declaraciones, la cascada y especifidad son un infierno y la sola idea de modificar componentes deprime a más de uno. Sass resuelve estos problemas dándole a Css las características de un lenguaje de programación y permitiendo modularizar el código (dividirlo en fragmentos reutilizables). Si escribes Css plano o ya conoces Sass pero quieres explorarlo más a fondo, este es tu curso.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	sass-desde-cero
28	Teoría del Diseño Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/design-poster-720_2.jpg?itok=wAdZFPr5	El diseño es un componente transversal en nuestras vidas, está presente en los objetos que usamos a diario y nos ha acompañado desde siempre, en todas las civilizaciones y comunidades, generando cambios en la sociedad. Hoy en día las empresas se posicionan y crecen de la mano del diseño, un proyecto emergente, una start up y cualquier propuesta de negocio necesita de una visión y aplicación estratégica del diseño. Este curso te enseñará los secretos que están detras de un diseño impactante y que usan los expertos y las grandes marcas.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	teoría-del-diseño-desde-cero
