29	Scrum Desde Cero	https://ed.team/sites/default/files/styles/large/public/courses/images/scrum_0.png?itok=tEBHbVGr	Creemos en las ideas que nacen como producto de la mejora continua, que buscan mejorar la vida de las personas, creemos que es importante ayudar a más personas a seguir creyendo en este tipo de sueños e ideas por mejorar el entorno que los rodea. Por eso ayudamos a las personas y equipos a convertir sus ideas en software funcionando utilizando metodologías ágiles, como evidencia de que hoy en día la tecnología es una gran herramienta que nos puede ayudar a todos a hacer un mundo mejor. Creemos también que no es necesario entender de código o programación si uno está vinculado con proyectos que no pasan por la creación de una app o algún producto que pasa por desarrollo de software, pero si ese no es el caso es necesario entender lo mínimo y necesario sobre código o programación, lo suficiente para poder generar sinergia con nuestro equipo de desarrollo, este es un factor de éxito para estos tiempos de innovación tecnológica. Por eso ayudamos a las personas involucradas en el trabajo con desarrolladores a salir de su zona de confort y se animen a perderle el miedo al código, no para convertirlos en programadores, pero sí para poder fluir en la construcción del producto digital como parte de un equipo de innovación tecnológica.	2018-02-01 03:04:04.009072	\N	t	f	\N	f	f	scrum-desde-cero
